import React from 'react';
import './Form.css'
const Form =(props)=>{
return (

    <div className="Form">
    <h4>Just demos</h4>
    <form>
      <input className="userName" type="text" id="username" name={props.name}  placeholder="username"></input>
      <br/>
      <br/>
      <input type="password" id="password" name="password" placeholder="password"></input>
      <br/>
      <br/>
      <button className="submit" name="The" type="submit">{props.name}</button>
      <button type="reset">Reset</button>
    </form>
  </div> 
)

}

export default Form;
